xt\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0,\"contribute\":{\"captionsMetadataRenderer\":{\"addSubtitlesText\":{\"runs\":[{\"text\":\"Add subtitles\/CC\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CAAQu2kiEwi-0s_R35jqAhWVLhYKHdBaCV0=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=TFxgUTW_F3s\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=TFxgUTW_F3s\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"TFxgUTW_F3s\",\"title\":\"Systems and Components of an Offshore Sailing Catamaran - Lagoon 410 Walkthrough\",\"lengthSeconds\":\"2550\",\"keywords\":[\"sailing catamaran\",\"liveaboard sailboat\",\"sailing around the world\"],\"channelId\":\"UCaJ_xrKTkBWMNbc8G-2SIwA\",\"isOwnerViewing\":false,\"shortDescription\":\"Full Equipment List: https:\/\/sailingnahoa.com\/systems-and-components-of-an-offshore-sailing-catamaran\/\\nOur Sailmaker: http:\/\/bit.ly\/precision_sails\\n\\nAfter three and a half years of sailing around the world and well over 10000 nautical miles we wanted to give you a tour of our floating home as it is now. Nahoa is a 2005 Lagoon 410 owners version that has carried us all this way. We have worked hard over these last years to set her up for long term offshore cruising. While there is always a project list and a wish list (new high output alternators, spinnaker, new Genoa), we are very happy with our current setup and wanted to share it with you. \\n\\nOur longest video to date includes a high level view of our main power, navigation and safety systems that enable us to live life off the grid. Dont worry you also get a detailed tour of the inside of our boat and the comforts that keep us happily sailing around the world! \\n\\nNahoa has had a huge remodel since we purchased her in 2015. We have done 2 refits to get her setup for comfort and to solve our power requirements. If you want to check out the before of Nahoa you can watch our first walkthrough video here: https:\/\/youtu.be\/T6F1YvTLPJw\\nNotice all the beautiful green has been replaced? Well that isnt all! Below we have a list of some of the main components we have added or replaced. This list does not include basic maintenance items since those are essentially relentless. It does however cover some of the bigger items which were replaced as they broke and wore out. We have found that in the last year, as the boat turned 12-13 years old, we have had to replace more of the remaining systems. Also the previous owner had replaced standing rigging and so that is something we have not had to yet tackle, but it will come up again soon! So without further rambling, if you are curious please check the exhaustive list below and I hope you enjoy the tour. \\n\\nPrevious Walk Through: https:\/\/youtu.be\/T6F1YvTLPJw\\n\\nPLEASE SUBSCRIBE: http:\/\/bit.ly\/2EmmGnL\\n\\nWANT US TO MAKE MORE VIDEOS? https:\/\/www.patreon.com\/nahoa\/posts\\n\\nFOLLOW US:\\nAsh Instagram: https:\/\/www.instagram.com\/ashstobbart\/\\nBen Instagram: https:\/\/www.instagram.com\/captainbenb\/\\nFacebook: https:\/\/www.facebook. 16822,\"aspectRatio\":1.0,\"startMs\":\"2530201\",\"endMs\":\"2550208\",\"title\":{\"accessibility\":{\"accessibilityData\":{\"label\":\"Sailing Nahoa, channel\"}},\"simpleText\":\"Sailing Nahoa\"},\"metadata\":{\"simpleText\":\"The average person our age is allowed a measly 10 days of vacation per year and has a car loan and mortgage to boot. That used to be us. Until we sold everything. We sold the house, the car, motorbike and most every possession. Even the winter clothes went out the window. We sold up to a life with less stuff. Less clutter. Less stress. A life that is untethered and unfiltered. We move from country to county as we wish. We poke into some the worlds least travelled corners. We live off the ocean when we can. Experience new cultures and sail vast distances without seeing land.\\n\\nThis is our recipe for Life. Perhaps it will inspire you. Hit that Subscribe button and Join us as we sail around the world!\\n\\nLove,\\n\\nBen \\u0026 Ashley\"},\"callToAction\":{\"simpleText\":\"VISIT CHANNEL\"},\"dismiss\":{\"simpleText\":\"CANCEL\"},\"endpoint\":{\"clickTrackingParams\":\"CAQQ-N4BGAAiEwi-0s_R35jqAhWVLhYKHdBaCV0yDGl2LWVuZHNjcmVlbkj7rvytk4qYrkw=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/channel\/UCaJ_xrKTkBWMNbc8G-2SIwA\",\"webPageType\":\"WEB_PAGE_TYPE_BROWSE\",\"rootVe\":3611}},\"browseEndpoint\":{\"browseId\":\"UCaJ_xrKTkBWMNbc8G-2SIwA\"}},\"hovercardButton\":{\"subscribeButtonRenderer\":{\"buttonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"subscribed\":false,\"enabled\":true,\"type\":\"FREE\",\"channelId\":\"UCaJ_xrKTkBWMNbc8G-2SIwA\",\"showPreferences\":false,\"subscribedButtonText\":{\"runs\":[{\"text\":\"SUBSCRIBED\"}]},\"unsubscribedButtonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"trackingParams\":\"CAUQmysiEwi-0s_R35jqAhWVLhYKHdBaCV0yDGl2LWVuZHNjcmVlbg==\",\"unsubscribeButtonText\":{\"runs\":[{\"text\":\"UNSUBSCRIBE\"}]},\"serviceEndpoints\":[{\"clickTrackingParams\":\"CAUQmysiEwi-0s_R35jqAhWVLhYKHdBaCV0yDGl2LWVuZHN ription\u0026v=TFxgUTW_F3s\u0026redir_token=cNsbUJI0O8qkHXGvNSBgAnLfAXB8MTU5MzAyOTU0M0AxNTkyOTQzMTQz\u0026q=https%3A%2F%2Fsailingnahoa.com%2Fsystems-and-components-of-an-offshore-sailing-catamaran%2F","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_description\u0026v=TFxgUTW_F3s\u0026redir_token=cNsbUJI0O8qkHXGvNSBgAnLfAXB8MTU5MzAyOTU0M0AxNTkyOTQzMTQz\u0026q=https%3A%2F%2Fsailingnahoa.com%2Fsystems-and-components-of-an-offshore-sailing-catamaran%2F","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nOur Sailmaker: "},{"text":"http://bit.ly/precision_sails","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMI99PP0d-Y6gIVDXEWCh0aLwC6SPuu_K2TipiuTA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=TFxgUTW_F3s\u0026redir_token=cNsbUJI0O8qkHXGvNSBgAnLfAXB8MTU5MzAyOTU0M0AxNTkyOTQzMTQz\u0026q=http%3A%2F%2Fbit.ly%2Fprecision_sails","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_description\u0026v=TFxgUTW_F3s\u0026redir_token=cNsbUJI0O8qkHXGvNSBgAnLfAXB8MTU5MzAyOTU0M0AxNTkyOTQzMTQz\u0026q=http%3A%2F%2Fbit.ly%2Fprecision_sails","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nAfter three and a half years of sailing around the world and well over 10000 nautical miles we wanted to give you a tour of our floating home as it is now. Nahoa is a 2005 Lagoon 410 owners version that has carried us all this way. We have worked hard over these last years to set her up for long term offshore cruising. While there is always a project list and a wish list (new high output alternators, spinnaker, new Genoa), we are very happy with our current setup and wanted to share it with you. \n\nOur longest video to date includes a high level view of our main power, navigation and safety systems that enable us to live life off the grid. Dont worry you also get a detailed tour of the inside of our boat and the comforts that keep us happily sailing around the world! \n\nNahoa has had a huge remodel since we purchased her in 2015. We have done 2 refits to get her setup for comfort and to solve our power requirements. If you want to check out the before of Nahoa you can watch our first walkthrough video here: "},{"text":"https://youtu.be/T6F1YvTLPJw","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMI99PP0d-Y6gIVDXEWCh0aLwC6","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=T6F1YvTLPJw","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"T6F1YvTLPJw"}}},{"text":"\nNotice all the beautiful green has been replaced? Well that isnt all! Below we have a list of some of the main components we have added or replaced. This list does not include basic maintenance items since those are essentially relentless. It does however cover some of the bigger items which were replaced as they broke and wore out. We have found that in the last year, as the boat turned 12-13 years old, we have had to replace more of the remaining systems. Also the previous owner had replaced standing rigging and so that is something we have not had to yet tackle, but it will come up again soon! So without further rambling, if you are curious please check the exhaustive list below and I hope you enjoy the tour. \n\nPrevious Walk Through: "},{"text":"https://youtu.be/T6F1YvTLPJw","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMI99PP0d-Y6gIVDXEWCh0aLwC6","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=T6F1YvTLPJw","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"T6F1YvTLPJw"}}},{"text":"\n\nPLEASE SUBSCRIBE: "},{"text":"http://bit.ly/2EmmGnL","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMI99PP0d-Y6gIVDXEWCh0aLwC6SPuu_K2TipiuTA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=TFxgUTW_F3s\u0026redir_token=cNsbUJI0O8qkHXGvNSBgAnLfAXB8MTU5MzAyOTU0M0AxNTkyOTQzMTQz\u0026q=http%3A%2F%2Fbit.ly%2F2EmmGnL","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_d aboard sailboat","sailing around the world"],"channelId":"UCaJ_xrKTkBWMNbc8G-2SIwA","isOwnerViewing":false,"shortDescription":"Full Equipment List: https://sailingnahoa.com/systems-and-components-of-an-offshore-sailing-catamaran/\nOur Sailmaker: http://bit.ly/precision_sails\n\nAfter three and a half years of sailing around the world and well over 10000 nautical miles we wanted to give you a tour of our floating home as it is now. Nahoa is a 2005 Lagoon 410 owners version that has carried us all this way. We have worked hard over these last years to set her up for long term offshore cruising. While there is always a project list and a wish list (new high output alternators, spinnaker, new Genoa), we are very happy with our current setup and wanted to share it with you. \n\nOur longest video to date includes a high level view of our main power, navigation and safety systems that enable us to live life off the grid. Dont worry you also get a detailed tour of the inside of our boat and the comforts that keep us happily sailing around the world! \n\nNahoa has had a huge remodel since we purchased her in 2015. We have done 2 refits to get her setup for comfort and to solve our power requirements. If you want to check out the before of Nahoa you can watch our first walkthrough video here: https://youtu.be/T6F1YvTLPJw\nNotice all the beautiful green has been replaced? Well that isnt all! Below we have a list of some of the main components we have added or replaced. This list does not include basic maintenance items since those are essentially relentless. It does however cover some of the bigger items which were replaced as they broke and wore out. We have found that in the last year, as the boat turned 12-13 years old, we have had to replace more of the remaining systems. Also the previous owner had replaced standing rigging and so that is something we have not had to yet tackle, but it will come up again soon! So without further rambling, if you are curious please check t
